import React from 'react';
import { Switch, Route } from 'react-router-dom';
import SearchBar from './Search/SearchBar';
import Details from './Search/Details';


const Routes = props => (
    <Switch>
        <Route exact path="/" component={SearchBar} />
    </Switch>
)

export default Routes;
